// SPDX-License-Identifier: MIT

pragma solidity ^0.7.0;

import '@openzeppelin/contracts/token/ERC20/ERC20.sol';
import "@openzeppelin/contracts/token/ERC20/SafeERC20.sol";
import './interfaces/IVault.sol';


/// @author Kindynos
/// @title Index Funds.
contract IndexFundV1 is ERC20 {
    using SafeMath for uint256;
    using SafeERC20 for IERC20;

    /// The controller that created this Fund.
    address public controller;
    /// The amount of tokens on this particular Fund.
    uint256 public tokenLength;
    // The reference to the tokens on the pool.
    IERC20[] _tokens;
    // Initial amounts of the underlying tokens.
    uint256[] _proportions;

    /// For money-earning strategies.
    struct TokenData {
        bool exist; // Helper var for initialization
        address vault;
        bool withVault;
    }

    // We invest 800/1000 of funds
    uint256 public investingNumerator = 800;
    // Fee if active is 5/1000 = 0.05%
    uint256 constant exitFeeNumerator = 5;

    // Boolean if this Fund has an exit Fee.
    bool public withExitFee;

    // Vault data for each token of the Fund.
    mapping(address => TokenData) public tokenData;
    // The current Funds reserves on the contract.
    uint256[] private _reserves;
    // The last block where the reserves were updated.
    uint256 private _lastBlock;

    // The representation of a single unit of the IFT.
    uint256 constant UNIT_AMOUNT = 1 ether;

    uint256 constant MAX_INT = 2**256 - 1;

    uint private unlocked = 1;

    event Wrap(address from, uint256 amount, uint256[] amountsPaid);
    event Unwrap(address from, uint256 amount, uint256[] amountsReturned);

    modifier lock() {
        require(unlocked == 1, 'IndexFund: LOCKED');
        unlocked = 0;
        _;
        unlocked = 1;
    }

    constructor() ERC20('Index Fund Token', 'IFT') {
        controller = msg.sender;
    }

    /**
     * @notice This function is called at creation to set the variables of the Fund.
     * @dev Assumed that the length of tokenArray is reasonable, and that the tokens/amounts are ordered.
     * @param _tokenArray The token addresses that make the fund.
     * @param _proportionsArray The amounts of the respective tokens that represent a (1) unit of the Fund Token.
     */
    function initialize(address[] memory _tokenArray,  uint256[] memory _proportionsArray) external {
        require(msg.sender == controller, 'Taco: FORBIDDEN');
        tokenLength = _tokenArray.length;
        require(tokenLength == _proportionsArray.length, "IndexFund: invalid arrays");
        for (uint i=0; i < tokenLength; i++) {
            // Validate correctness of the array
            require(!tokenData[_tokenArray[i]].exist, "WrappedFund: duplicate address");
            _tokens.push(IERC20(_tokenArray[i]));
            _reserves.push(0);
            tokenData[_tokenArray[i]].exist = true;
        }

        _proportions = _proportionsArray;
    }

    /**
      * @notice Modify amount that is invested from an IndexFund
      * @param _num The new numerator.
      */
    function setInvestingNumerator(uint256 _num) external {
        require(msg.sender == controller, 'Taco: FORBIDDEN');
        require(_num < 1000);
        investingNumerator = _num;
    }

    /**
      * @notice @notice Set if an IndexFund has the 0.05 exit Fee.
      * @dev The fee is kept in the Fund for the other users, is not a dev fee.
      * @param _withFee If the fee is active or not.
      */
    function setExitFee(bool _withFee) external {
        require(msg.sender == controller, 'Taco: FORBIDDEN');
        withExitFee = _withFee;
    }

    /**
      * @notice Changes the vaults on which the fund's tokens are invested. Can be set to the 0 address to disable investing.
      * @dev 3 cases: same vault skip, zero address vault disable, different vault replace.
      * @param _vaults The addresses of the new vaults.
      */
    function setVaults(address[] memory _vaults) external {
        require(msg.sender == controller, 'Taco: FORBIDDEN');
        require(_vaults.length == tokenLength, "Taco: invalid array");
        for (uint i=0; i < tokenLength; i++) {
            address currentToken = address(_tokens[i]);
            IVault currentVault = IVault(tokenData[currentToken].vault);
            // The vault must be valid or null
            if(_vaults[i] == address(0)){
                // In case of retiring a vault
                if(tokenData[currentToken].withVault){
                    currentVault.withdrawAll();
                    tokenData[currentToken].vault = address(0);
                    tokenData[currentToken].withVault = false;
                }
                continue;
            }
            require(IVault(_vaults[i]).underlying() == _tokens[i], "invalid vault");
            // In case of replacing a vault
            if(_vaults[i] != address(currentVault)){
                if(tokenData[currentToken].withVault){
                    currentVault.withdrawAll();
                }
                tokenData[currentToken].vault = _vaults[i];
                tokenData[currentToken].withVault = true;
            }
        }
    }



    /**
      * @notice Estimates the max amount of IFT that can be minted from amounts given.
      * @dev _amounts should be in order.
      * @param _amounts The token amounts for the underlying tokens.
      * @return The max amount of tokens that can be minted.
      */
    function estimateAmountOut(uint256[] memory _amounts) public view returns (uint256) {
        require(_amounts.length == tokenLength);
        uint256 n = MAX_INT;
        for (uint i=0; i< tokenLength; i++) {
            uint256 minA;
            if(totalSupply() == 0){
                minA = _amounts[i].mul(UNIT_AMOUNT).div(_proportions[i]);
            }
            else {
                minA = _amounts[i].mul(totalSupply()).div(getBalanceOfThis(_tokens[i]));
            }
            if (minA < n) {
                n = minA;
            }
        }
        return n;
    }

    /**
      * @notice Estimates the amounts of underlying tokens needed to mint the specified amount of IFT
      * @param _amount Amount that wants to be minted.
      * @return The amount for each token required.
      */
    function estimateAmountIn(uint256 _amount) public view returns (uint256[] memory) {
        uint256[] memory prices = new uint256[](tokenLength);
        for (uint i = 0; i < tokenLength; i++) {
            if(totalSupply() == 0){
                prices[i] = _amount.mul(_proportions[i]).div(UNIT_AMOUNT);
            }
            else {
                prices[i] = _amount.mul(getBalanceOfThis(_tokens[i])).div(totalSupply());
            }
        }
        return prices;
    }

    /**
      * @notice Takes the proportionate underlying tokens from the user to the contract and mints new IFT.
      * @dev Should be called from a Helper contract for safety. Remnants will not be refunded.
      * @param _amount Amount that wants to be minted.
      * @param _to The address that receives the IFT.
      * @return The amount minted.
      */
    function wrap(uint256 _amount, address _to) public lock returns(uint256) {
        uint256[] memory prices = new uint256[](tokenLength);
        for (uint i = 0; i < tokenLength; i++) {
            uint256 balance = _tokens[i].balanceOf(address(this));
            uint256 amountReceived = balance.sub(_reserves[i]);
            if(totalSupply() == 0){
                prices[i] = _amount.mul(_proportions[i]).div(UNIT_AMOUNT);
            }
            else {
                prices[i] = _amount.mul(getBalanceOfThis(_tokens[i]).sub(amountReceived)).div(totalSupply());
            }
            require( amountReceived >= prices[i], "not enough amounts");
            // update reserves
            _reserves[i] = balance;

        }
        _lastBlock = block.number;
        _mint(_to, _amount);
        emit Wrap(_to, _amount, prices);
        return _amount;
    }

    /**
      * @notice Burns the WFT and returns the proportionate underlying tokens to the user.
      * @dev Charges a 0.005 fee if the variable withExitFee is true.
      * @param _to The address that receives the Funds.
      * @return The amount of underlying funds transferred.
      */
    function unwrap(address _to) public lock returns(uint256[] memory) {
        uint256 _amount = balanceOf(address(this));
        uint256[] memory amounts = new uint256[](tokenLength);
        for (uint i = 0; i < tokenLength; i++) {
            uint256 balance = getBalanceOfThis(_tokens[i]);
            uint256 tokenAmount = _amount.mul(balance).div(totalSupply());
            // 0.05 exit fee
            if(withExitFee){
                tokenAmount = tokenAmount.mul(exitFeeNumerator).div(1000);
            }
            amounts[i] = fundSafeTransfer(_tokens[i], _to, tokenAmount);
            // update _reserves
            _reserves[i] = _tokens[i].balanceOf(address(this));
        }
        _burn(address(this), _amount);
        _lastBlock = block.number;
        emit Unwrap(_to, _amount, amounts);
        return amounts;
    }

    /**
      * @notice Invests a percentage of the funds into their respective vaults.
      * @dev The percentage is defined by the investingNumerator var.
      */
    function invest() external {
        for (uint i = 0; i < tokenLength; i++) {
            TokenData memory data = tokenData[address(_tokens[i])];
            if(data.withVault){
                uint256 amount = _reserves[i].mul(investingNumerator).div(1000);
                _tokens[i].safeApprove(data.vault, amount);
                IVault(data.vault).deposit(amount);
            }
        }
        sync();
    }

    /**
      * @notice Returns reserves held in the contract only.
      * @return The amount for each underlying token.
      * @return lastBlock The block where this value was last updated.
      */
    function getReserves() public view returns (uint256[] memory, uint256 lastBlock) {
        return (_reserves, _lastBlock);
    }

    /**
      * @notice Returns reserves held in the contract + investments
      * @return realReserves The total reserves for each token.
      */
    function getTotalReserves() public view returns (uint256[] memory realReserves) {
        realReserves = new uint[](tokenLength);
        for (uint i = 0; i < tokenLength; i++) {
            realReserves[i] = getBalanceOfThis(_tokens[i]);
        }
        return realReserves;
    }

    // Get real balance of a token, accounting amount invested
    function getBalanceOfThis(IERC20 _token) internal view returns (uint256) {
        uint256 balance = _token.balanceOf(address(this));
        TokenData memory data = tokenData[address(_token)];
        if(data.withVault){
            uint256 shareBalance = IERC20(data.vault).balanceOf(address(this));
            // add the deposited balance
            balance = balance.add(shareBalance.mul(IVault(data.vault).getPricePerFullShare()).div(UNIT_AMOUNT));
        }
        return balance;
    }

    // Safe transfer withdrawing from vault when in need of funds.
    function fundSafeTransfer(IERC20 _token, address _to, uint256 _amount) internal returns(uint256){
        uint256 underlyingBal = _token.balanceOf(address(this));
        if (underlyingBal < _amount) {
            // If we don't have the required amount, withdraw the missing amount from vault and send it all
            TokenData memory data = tokenData[address(_token)];
            uint256 toRedeem = _amount.sub(underlyingBal);
            uint256 amountInShares = toRedeem.mul(UNIT_AMOUNT).div(IVault(data.vault).getPricePerFullShare());
            IVault(data.vault).withdraw(amountInShares);
            // we send what we can. Helper should check if this amount is enough/intended
            _amount = _token.balanceOf(address(this));
        }
        _token.safeTransfer(_to, _amount);
        return _amount;
    }

    /// Match reserves to balances
    function sync() public lock {
        for (uint i = 0; i < tokenLength; i++) {
            _reserves[i] = _tokens[i].balanceOf(address(this));
        }
        _lastBlock = block.number;
    }

    /// The reference to the tokens on the pool.
    function tokens() external view returns (IERC20[] memory) {
        return _tokens;
    }

    /// Initial amounts of the underlying tokens.
    function proportions() external view returns (uint256[] memory) {
        return _proportions;
    }

    /// Price for a unit (1) of the Index Fund Token
    function lastUnitPrices() external view returns (uint256[] memory) {
        return estimateAmountIn(UNIT_AMOUNT);
    }

}

